/* Compute the singular field at the point x for the particle at xp */
void effsource_phis(struct coordinate * x, double * phis)
{

  double A, s2;

  double r      = x->r;
  double theta  = x->theta;
  double phi    = x->phi;
  double rp     = xp.r;
  double thetap = xp.theta;
  double phip   = xp.phi;

  double dr     = r - rp;
  double dtheta = theta - thetap;
  double dphi   = phi - phip;

  double dr2      = dr*dr;
  double dr3      = dr2*dr;
  double dr4      = dr2*dr2;
  double dr5      = dr3*dr2;
  double dtheta2  = dtheta*dtheta;
  double dtheta4  = dtheta2*dtheta2;
  double Q        = sin(0.5*dphi);
  double Q2       = Q*Q;
  double Q4       = Q2*Q2;
  double R        = sin(dphi);
  double R3       = R*R*R;
  double R5       = R3*R*R;

  A = A2000*dr2 + A3000*dr3 + A4000*dr4 + A5000*dr5 + A0200*dtheta2 + A1200*dr*dtheta2 + A2200*dr2*dtheta2 + A3200*dr3*dtheta2 + A0400*dtheta4 + A1400*dr*dtheta4 + A0020*Q2 + A1020*dr*Q2 + A2020*dr2*Q2 + A3020*dr3*Q2 + A0220*dtheta2*Q2 + A1220*dr*dtheta2*Q2 + A0040*Q4 + A1040*dr*Q4 + A1001*dr*R + A2001*dr2*R + A3001*dr3*R + A4001*dr4*R + A0201*dtheta2*R + A1201*dr*dtheta2*R + A2201*dr2*dtheta2*R + A0401*dtheta4*R + A0003*R3 + A1003*dr*R3 + A2003*dr2*R3 + A0203*dtheta2*R3 + A0005*R5;

  s2 = R3*s20003 + R5*s20005 + Q2*s20020 + Q4*s20040 + dtheta2*s20200 + dtheta2*R*s20201 + dtheta2*R3*s20203 + dtheta2*Q2*s20220 + dtheta4*s20400 + dtheta4*R*s20401 + dr*R*s21001 + dr*R3*s21003 + dr*Q2*s21020 + dr*Q4*s21040 + dr*dtheta2*s21200 + dr*dtheta2*R*s21201 + dr*dtheta2*Q2*s21220 + dr*dtheta4*s21400 + dr2*s22000 + dr2*R*s22001 + dr2*R3*s22003 + dr2*Q2*s22020 + dr2*dtheta2*s22200 + dr2*dtheta2*R*s22201 + dr3*s23000 + dr3*R*s23001 + dr3*Q2*s23020 + dr3*dtheta2*s23200 + dr4*s24000 + dr4*R*s24001 + dr5*s25000;

  *phis = A/(24.*pow(s2, 1.5));
}

