  double thetap = xp.theta;
  double phip   = xp.phi;

  double dr     = r - rp;
  double dtheta = theta - thetap;
  double dphi   = phi - phip;

  double dr2      = dr*dr;
  double dr3      = dr2*dr;
  double dr4      = dr2*dr2;
  double dr5      = dr3*dr2;
  double dtheta2  = dtheta*dtheta;
  double dtheta3  = dtheta2*dtheta;
  double dtheta4  = dtheta2*dtheta2;
  
  double Q        = sin(0.5*dphi);
  double Q2       = Q*Q;
  double Q3       = Q2*Q;
  double Q4       = Q2*Q2;
  double R        = sin(dphi);
  double R2       = R*R;
  double R3       = R2*R;
  double R4       = R2*R2;
  double R5       = R3*R2;
