  dA_dr     = 2*A2000*dr + 3*A3000*dr2 + 4*A4000*dr3 + 5*A5000*dr4 + A1200*dtheta2 + 2*A2200*dr*dtheta2 + 3*A3200*dr2*dtheta2 + A1400*dtheta4 + A1020*Q2 + 2*A2020*dr*Q2 + 3*A3020*dr2*Q2 + A1220*dtheta2*Q2 + A1040*Q4 + A1001*R + 2*A2001*dr*R + 3*A3001*dr2*R + 4*A4001*dr3*R + A1201*dtheta2*R + 2*A2201*dr*dtheta2*R + A1003*R3 + 2*A2003*dr*R3;
  dA_dth    = 2*A0200*dtheta + 2*A1200*dr*dtheta + 2*A2200*dr2*dtheta + 2*A3200*dr3*dtheta + 4*A0400*dtheta3 + 4*A1400*dr*dtheta3 + 2*A0220*dtheta*Q2 + 2*A1220*dr*dtheta*Q2 + 2*A0201*dtheta*R + 2*A1201*dr*dtheta*R + 2*A2201*dr2*dtheta*R + 4*A0401*dtheta3*R + 2*A0203*dtheta*R3;
