  d2A_dr2   = 2*A2000 + 6*A3000*dr + 12*A4000*dr2 + 20*A5000*dr3 + 2*A2200*dtheta2 + 6*A3200*dr*dtheta2 + 2*A2020*Q2 + 6*A3020*dr*Q2 + 2*A2001*R + 6*A3001*dr*R + 12*A4001*dr2*R + 2*A2201*dtheta2*R + 2*A2003*R3;
