  d2A_dt2   = d2Adt20000 + d2Adt21000*dr + d2Adt22000*dr2 + d2Adt23000*dr3 + d2Adt24000*dr4 + d2Adt25000*dr5 + d2Adt20200*dtheta2 + d2Adt21200*dr*dtheta2 + d2Adt22200*dr2*dtheta2 + d2Adt23200*dr3*dtheta2 + d2Adt20400*dtheta4 + d2Adt21400*dr*dtheta4 + d2Adt20020*Q2 + d2Adt21020*dr*Q2 + d2Adt22020*dr2*Q2 + d2Adt23020*dr3*Q2 + d2Adt24020*dr4*Q2 + d2Adt20220*dtheta2*Q2 + d2Adt21220*dr*dtheta2*Q2 + d2Adt22220*dr2*dtheta2*Q2 + d2Adt20420*dtheta4*Q2 + d2Adt20040*Q4 + d2Adt21040*dr*Q4 + d2Adt20001*R + d2Adt21001*dr*R + d2Adt22001*dr2*R + d2Adt23001*dr3*R + d2Adt24001*dr4*R + d2Adt20201*dtheta2*R + d2Adt21201*dr*dtheta2*R + d2Adt22201*dr2*dtheta2*R + d2Adt20401*dtheta4*R + d2Adt20021*Q2*R + d2Adt21021*dr*Q2*R + d2Adt22021*dr2*Q2*R + d2Adt20221*dtheta2*Q2*R + d2Adt20041*Q4*R + d2Adt21041*dr*Q4*R + d2Adt22041*dr2*Q4*R + d2Adt20241*dtheta2*Q4*R + d2Adt20002*R2 + d2Adt21002*dr*R2 + d2Adt22002*dr2*R2 + d2Adt20202*dtheta2*R2 + d2Adt20022*Q2*R2 + d2Adt21022*dr*Q2*R2 + d2Adt22022*dr2*Q2*R2 + d2Adt20222*dtheta2*Q2*R2 + d2Adt20003*R3 + d2Adt21003*dr*R3 + d2Adt22003*dr2*R3 + d2Adt20203*dtheta2*R3 + d2Adt20023*Q2*R3 + d2Adt20043*Q4*R3 + d2Adt20004*R4 + d2Adt20024*Q2*R4 + d2Adt20005*R5;
