  /* s, ds/dr, d^2s/dr^2 */
  s2         = R3*s20003 + R5*s20005 + Q2*s20020 + Q4*s20040 + dtheta2*s20200 + dtheta2*R*s20201 + dtheta2*R3*s20203 + dtheta2*Q2*s20220 + dtheta4*s20400 + dtheta4*R*s20401 + dr*R*s21001 + dr*R3*s21003 + dr*Q2*s21020 + dr*Q4*s21040 + dr*dtheta2*s21200 + dr*dtheta2*R*s21201 + dr*dtheta2*Q2*s21220 + dr*dtheta4*s21400 + dr2*s22000 + dr2*R*s22001 + dr2*R3*s22003 + dr2*Q2*s22020 + dr2*dtheta2*s22200 + dr2*dtheta2*R*s22201 + dr3*s23000 + dr3*R*s23001 + dr3*Q2*s23020 + dr3*dtheta2*s23200 + dr4*s24000 + dr4*R*s24001 + dr5*s25000;
